webpackJsonp([75162720310561],{488:function(n,a){n.exports={data:{markdownRemark:{html:'<h1>数据库学习（二）(待续)</h1>\n<h3>子查询</h3>\n<p>表达式表示一个计算结果，子查询的结果仍然是一个关系，\n两个关系做笛卡尔积，之后从中选取满足一定条件的子集，就叫做连接。\n连接两个表的操作，会被用在</p>\n<ul>\n<li>等值连接查询</li>\n<li>自然连接查询</li>\n<li>非等值连接查询</li>\n<li>自身连接查询</li>\n<li>外连接查询</li>\n<li>复合条件连接查询</li>\n</ul>\n<h2>等值连接查询</h2>\n<p>等值连接和非等值连接是对立的。对两张表做笛卡尔积后，选择其中某些属性相同的元祖，称为等秩连接。</p>\n<p>等值连接之后</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">select</span> <span class="token operator">*</span> <span class="token keyword">from</span> course<span class="token punctuation">,</span>\n</code></pre>\n      </div>',frontmatter:{title:"数据库学习（二）",date:"2018-02-18",tags:["MySQL","SQL"]}}},pathContext:{slug:"/2018-02-18---database-2/"}}}});
